import React from "react"

function About(){
    return (
        <div>
            <h1>Ackley Brothers</h1>
            <br />
            <h2>Plumbing and Electric</h2>
            <hr />
            <p>We are known for our hard work and our on time service.</p>
        </div>
    )
}

export default About
